import { BrowserRouter } from "react-router-dom";
import Media from "react-media";

function Res(){
  return (
    <body className="Res">
      <Media query="{min-width: 600px}">
        {(matches) => {
          return matches ? 'Hello' : 'World!';
        }}
      </Media>
    </body>
  )
}

const rootElement = document.getElementById('root');

ReactDOM.render(
  <Res>
  <BrowserRouter>
    <Res/>
